INSERT INTO `news` (`id`, `name`, `description`, `editor`, `content`, `cover`, `image_list`, `created_at`, `updated_at`) VALUES
('1dbee646-7534-47ef-bf89-a941c5cde33b', 'ประชุมชี้แจงการติดตาม ประเมินผลการบริหารและการจัดการศึกษาขั้นพื้นฐาน ของสพฐ. ประจำปีงบประมาณ พ.ศ. 2566', 'วันพุธที่ 5 กรกฎาคม 2566 เวลา 10.00 น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร เป็นประธานการประชุมชี้แจงการติดตาม ปร', 'admin', 'วันพุธที่ 5 กรกฎาคม 2566 เวลา 10.00 น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร เป็นประธานการประชุมชี้แจงการติดตาม ประเมินผลการบริหารและการจัดการศึกษาขั้นพื้นฐาน ของสพฐ. ประจำปีงบประมาณ พ.ศ. 2566 พร้อมด้วย นายชลาวุธ สามาอาพัฒน์ รองผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร นายบุญธรรม อ้วนกันยา รองผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร ผู้อำนวยการกลุ่ม/หน่วย บุคลากรที่เกี่ยวข้อง ณ ห้องประชุมภูมิพลังแผ่นดิน สำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร จึงเรียนมาเพื่อโปรดทราบ', 'n-1691330699464-S__10641505-1024x769.jpg', 'n-1691330699464-S__10641509-1024x769.jpg;n-1691330699465-S__10641512-1024x769.jpg;n-1691330699465-S__10641515-1024x769.jpg;n-1691330699465-S__10641521-1024x769.jpg;n-1691330699466-S__10641523-1024x769.jpg', '2023-08-06 14:04:59', '2023-08-06 14:04:59'),
('2136f8b0-3a8b-4c3f-880f-98e09e4cc656', 'นิเทศ ติดตามคุณภาพการศึกษาโรงเรียนคุณภาพเพื่อทราบความก้าวหน้าในการพัฒนาคุณภาพการศึกษา', 'วันจันทร์ที่ ๑๐ กรกฎาคม ๒๕๖๖ เวลา ๐๙.๐๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้', 'admin', 'วันจันทร์ที่ ๑๐ กรกฎาคม ๒๕๖๖ เวลา ๐๙.๐๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายวิชาญ เกษเพชร รองผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร พร้อมด้วยคณะกรรมการดำเนินงานการขับเคลื่อนโรงเรียนคุณภาพและคณะศึกษานิเทศก์ สพม.สกลนคร และ ออกนิเทศ ติดตามคุณภาพการศึกษาโรงเรียนคุณภาพเพื่อทราบความก้าวหน้าในการพัฒนาคุณภาพการศึกษา ณ โรงเรียนสกลนครพัฒนศึกษา', 'n-1691330581956-435836.jpg', 'n-1691330581958-435834.jpg;n-1691330581959-435839-768x1127.jpg;n-1691330581959-435840.jpg;n-1691330581960-435841.jpg', '2023-08-06 14:03:01', '2023-08-06 14:03:01'),
('214c130f-e62c-4ffd-9744-34ba102ae0f6', 'การอบรมเชิงปฏิบัติการพัฒนาบุคลากรระบบเครือข่ายคอมพิวเตอร์ ครูและนักเรียน ของโรงเรียนในสังกัด สำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร', 'วันที่ ๒๒ กรกฎาคม ๒๕๖๖ เวลา ๐๘.๓๐ -๑๖.๓๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่ การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายชลาวุธ สามาอาพัฒน', 'admin', 'วันที่ ๒๒ กรกฎาคม ๒๕๖๖ เวลา ๐๘.๓๐ -๑๖.๓๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่ การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายชลาวุธ สามาอาพัฒน์ รองผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร เป็นประธานการอบรมเชิงปฏิบัติการพัฒนาบุคลากรระบบเครือข่ายคอมพิวเตอร์ ครูและนักเรียน ของโรงเรียนในสังกัด สำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร เพื่อการป้องกัน รับมือ ลดความเสี่ยง จากภัยคุกคามทางไซเบอร์ และภัย 9 ประเภท ณ หอประชุมโรงเรียนสกลราชวิทยานุกูล', 'n-1691330746896-LINE_ALBUM_ESPORTS_à¹à¹à¹à¹à¹à¹_38-1024x768.jpg', 'n-1691330746896-LINE_ALBUM_ESPORTS_à¹à¹à¹à¹à¹à¹_2-1024x1024.jpg;n-1691330746897-LINE_ALBUM_ESPORTS_à¹à¹à¹à¹à¹à¹_5-1024x768.jpg;n-1691330746898-LINE_ALBUM_ESPORTS_à¹à¹à¹à¹à¹à¹_18-1024x768.jpg;n-1691330746898-LINE_ALBUM_ESPORTS_à¹à¹à¹à¹à¹à¹_32.jpg', '2023-08-06 14:05:46', '2023-08-06 14:05:46'),
('4265bf2b-6bf0-4449-ab07-031be682df4e', 'สพม.สกลนคร ลงพื้นที่ นิเทศ ติดตามการดำเนินงาน ของโรงเรียนในโครงการพัฒนาเด็กและเยาวชนในถิ่นทุรกันดารฯ (ก.พ.ด.) ณ โรงเรียนโพธิแสนวิทยา', 'วันพุธที่ ๕ กรกฎาคม ๒๕๖๖ เวลา ๐๙.๐๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายวิชาญ เกษเพชร', 'admin', 'วันพุธที่ ๕ กรกฎาคม ๒๕๖๖ เวลา ๐๙.๐๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายวิชาญ เกษเพชร รองผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร พร้อมด้วยคณะศึกษานิเทศก์ ออกนิเทศ ติดตามการดำเนินงาน ของโรงเรียนในโครงการพัฒนาเด็กและเยาวชนในถิ่นทุรกันดารฯ (ก.พ.ด.) ณ โรงเรียนโพธิแสนวิทยา จังหวัดสกลนคร', 'n-1691330617816-S__5128242_0.jpg', 'n-1691330617824-989666-1536x1152.jpg;n-1691330617825-989702-1536x1152.jpg;n-1691330617826-989894-1536x1152.jpg;n-1691330617827-989898-1536x1152.jpg', '2023-08-06 14:03:37', '2023-08-06 14:03:37'),
('a2725afa-c986-4a09-824e-b3d677372a99', 'สพม.สกลนคร ลงพื้นที่ นิเทศ ติดตามการดำเนินงาน ของโรงเรียนในโครงการพัฒนาเด็กและเยาวชนในถิ่นทุรกันดารฯ (ก.พ.ด.) ณ โรงเรียนบ้านม่วงพิทยาคม จังหวัดสกลนคร', 'วันพฤหัสบดีที่ ๖ กรกฎาคม ๒๕๖๖ เวลา ๐๙.๐๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายวิชาญ เกษเพชร', 'admin', 'วันพฤหัสบดีที่ ๖ กรกฎาคม ๒๕๖๖ เวลา ๐๙.๐๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายวิชาญ เกษเพชร รองผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร พร้อมด้วยคณะศึกษานิเทศก์ ออกนิเทศ ติดตามการดำเนินงาน ของโรงเรียนในโครงการพัฒนาเด็กและเยาวชนในถิ่นทุรกันดารฯ (ก.พ.ด.) ณ โรงเรียนบ้านม่วงพิทยาคม จังหวัดสกลนคร', 'n-1691330660407-991028-1024x768.jpg', 'n-1691330660408-991021-1024x768 (1).jpg;n-1691330660409-991021-1024x768.jpg;n-1691330660410-991028-1024x768.jpg', '2023-08-06 14:04:20', '2023-08-06 14:04:20'),
('b4a59c8e-fbf1-47c0-b7ca-00078aba33e4', 'การประชุมคณะกรรมการการแข่งขันกีฬาอีสปอร์ตระดับการศึกษาขั้นพื้นฐานของโรงเรียนในสังกัด สำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร', 'วันที่ ๒๗ กรกฎาคม ๒๕๖๖ เวลา ๐๙.๐๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายชลาวุธ สามาอาพัฒน์ รองผู้', 'admin', 'วันที่ ๒๗ กรกฎาคม ๒๕๖๖ เวลา ๐๙.๐๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายชลาวุธ สามาอาพัฒน์ รองผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร เป็นประธานการประชุมคณะกรรมการการแข่งขันกีฬาอีสปอร์ตระดับการศึกษาขั้นพื้นฐาน พร้อมด้วย คณะกรรมการ ณ ห้องประชุมภูมิพลังแผ่นดิน สำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร', 'n-1691330817167-S__11943944-1024x683.jpg', 'n-1691330817168-213373-768x1024.jpg;n-1691330817168-IMG_7211-1024x683.jpg;n-1691330817169-IMG_7242-1024x683.jpg;n-1691330817170-S__11943945-1024x683.jpg;n-1691330817170-S__11943963-1024x683.jpg', '2023-08-06 14:06:57', '2023-08-06 14:06:57'),
('f0294376-e64d-4266-964b-94016491eab4', 'สพม.สกลนคร ประชุมเชิงปฏิบัติการจัดทำแนวทางการดำเนินงานอีสปอร์ต(ESPORTS) ต่อยอดนวัตกรรมทางการศึกษา', 'วันที่ ๑๘ – ๒๓ กรกฎาคม ๒๕๖๖ เวลา ๐๘.๓๐ -๑๖.๓๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายชลาวุธ สามาอา', 'admin', 'วันที่ ๑๘ – ๒๓ กรกฎาคม ๒๕๖๖ เวลา ๐๘.๓๐ -๑๖.๓๐ น. นายมงคลชัย รัตนอ่อน ผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร มอบหมายให้ นายชลาวุธ สามาอาพัฒน์ รองผู้อำนวยการสำนักงานเขตพื้นที่การศึกษามัธยมศึกษาสกลนคร เป็นประธานกรรมการคณะกรรมการฝ่ายจัดทำแนวทางการดำเนินงานอีสปอร์ตฯ ณ โรงแรมบ้านไทยบูทีค กรุงเทพมหานคร พร้อมด้วยคณะครูในสังกัด', 'n-1691567052332-LINE_ALBUM_ESPORTS_à¹à¹à¹à¹à¹à¹_38-1024x768.jpg', 'n-1691567052333-LINE_ALBUM_ESPORTS_à¹à¹à¹à¹à¹à¹_2-1024x1024.jpg;n-1691567052335-LINE_ALBUM_ESPORTS_à¹à¹à¹à¹à¹à¹_5-1024x768.jpg;n-1691567052337-LINE_ALBUM_ESPORTS_à¹à¹à¹à¹à¹à¹_18-1024x768.jpg', '2023-08-09 07:44:12', '2023-08-09 07:44:12');
